        .svg-container

        .d3-tip
        {
            line-height: 1;
            font-weight: bold;
            padding: 12px;
            background: rgba(0, 0, 0, 0.8);
            color: #fff;
            border-radius: 2px;
            pointer-events: none;
        }

            /* Creates a small triangle extender for the tooltip */
            .d3-tip:after
            {
                box-sizing: border-box;
                display: inline;
                font-size: 10px;
                width: 100%;
                line-height: 1;
                color: rgba(0, 0, 0, 0.8);
                position: absolute;
                pointer-events: none;
            }

            /* Northward tooltips */
            .d3-tip.n:after
            {
                content: "\25BC";
                margin: -1px 0 0 0;
                top: 100%;
                left: 0;
                text-align: center;
            }

            /* Eastward tooltips */
            .d3-tip.e:after
            {
                content: "\25C0";
                margin: -4px 0 0 0;
                top: 50%;
                left: -8px;
            }

            /* Southward tooltips */
            .d3-tip.s:after
            {
                content: "\25B2";
                margin: 0 0 1px 0;
                top: -8px;
                left: 0;
                text-align: center;
            }

            /* Westward tooltips */
            .d3-tip.w:after
            {
                content: "\25B6";
                margin: -4px 0 0 -1px;
                top: 50%;
                left: 100%;
            }
    </style>

    <script type="text/javascript">

        var DE = d3.locale({
            decimal: ",",
            thousands: ".",
            grouping: [3],
            currency: ["", " €"],
            dateTime: "%A, %e de %B de %Y, %X",
            date: "%d.%m.%Y",
            time: "%H:%M:%S",
            periods: ["AM", "PM"],
            days: ["Sonntag", "Montag", "Dienstag", "Mittwoch", "Donnerstag", "Freitag", "Samstag"],
            shortDays: ["So", "Mo", "Di", "Mi", "Do", "Fr", "Sa"],
            months: ["Januar", "Februar", "März", "April", "Mai", "Juni", "Juli", "August", "September", "Oktober", "November", "Dezember"],
            shortMonths: ["Jan", "Feb", "Mär", "Apr", "Mai", "Jun", "Jul", "Aug", "Sep", "Okt", "Nov", "Dez"]
        });

        /**
         * Fügt die Eigenschaft 'mappedData' zu einem Feature hinzu, wenn in 'data' ein element mittels der Funktion 'mapping' gefunden wurde.
         * @param {featureCollection} featureCollection Die FeatureCollection, in die geschrieben werden soll.
         * @param {array} data Die Daten, welche zu einem Feature gemappt werden sollen.
         * @param {function} mapping Das Mapping, mit dem die Beziehung zwischen Feature und Data beschrieben wird.
         */
        var mergeDataIntoFeatures = function(featureCollection, data, mapping) {
            featureCollection.features.forEach(function(f) {
                var found = $.rki.utils.array.firstOrDefault(data, function(d) { return mapping(d, f); });
                if (found) {
                    f.mappedData = found.element;
                }
            });
        }

        /**
         * Filtert die übergeben FeatureCollection und gibt eine neue FeatureCollection zurück, welche lediglich die Features enthält, die dem 'filterPredicate' entsprechen.
         * @param {featureCollection} featureCollection Die zu filternde FeatureCollection
         * @param {function} filterPredicate Das Prädikat, welches angibt vom Feature erfüllt werden muss.
         * @returns Eine neue FeatureCollection mit den Features, die das Prädikat erfüllen.
         */
        var filterFeatureCollection = function(featureCollection, filterPredicate) {
            return {
                type: 'FeatureCollection',
                features: featureCollection.features.filter(filterPredicate)
            }
        }

        /**
         * Erzeugt eine Karte der Landkreise mit den übergebenen Daten. Zusätzlich kan ein Filter übergeben werden, welches es ermöglicht die dargestellten Features zu filtern.
         * @param {array} data Die anzuzeigenden Daten.
         * @param {function} featureFilter Ein Filter, der die anzuzeigenden Features einschränkt.
         * @returns Ein Kartenobjekt der Form '{ scale: <genutzteFarbskala>, control: <dasErzeugteMapControl>, featureCollection: <dieUngefilterteFeatureCollection>, filteredFeatureCollection: <dieGefilterteFeatureCollection> }'
         */
        var createLkMap = function(data, featureFilter) {
            var obj = {
                scale: d3.scale.linear().domain(d3.extent(data, function(d) { return d.value; })).range(["yellow", "red"]),
                control: $.rki.chart.map.create({ element: "#lk", height: 700 }),
            };

            // featureCollection erzeugen und Daten in die Features mappen
            var featureCollection = topojson.feature(lkTopo, lkTopo.objects.landkreis2012);
            mergeDataIntoFeatures(featureCollection, data, function(d, f) {
                return d.id.id === "[" + f.properties.RKI_ID + "]";
            });

            obj.featureCollection = featureCollection;
            // featureCollection filtern
            obj.filteredFeatureCollection = filterFeatureCollection(featureCollection, featureFilter);

            // Layer mit featureCollection erzeugen und zentrieren. Die fill-Eigenschaft eines Polygons wird mit der erzeugten Farbskala ermittelt.
            obj.control.centerLayer(
                obj.control.addLayer("landkreis", obj.filteredFeatureCollection, function(p) {
                    p.attr("fill", function(d) {
                        return obj.scale(d.mappedData.value);
                    }).classed("landkreis", true);
                })
            );

            return obj;
        }

        /**
         * Erzeugt eine Karte der Bundesländer mit den übergebenen Daten. Zusätzlich kann eine Funktion übergeben werden, die ausgeführt wird, wenn auf ein Bundesland-Polygon geklickt wird.
         * @param {array} data Die anzuzeigenden Daten.
         * @param {function} onBlFeatureClick  Eine Funktion, die aufgerufen wird, wenn eine Bundesland-Polygon geklickt wird.
         * @returns Ein Kartenobjekt der Form '{ scale: <genutzteFarbskala>, control: <dasErzeugteMapControl>, featureCollection: <genutzteFeatureCollection>, layer: <derErzeugteBundeslandLayer>, selectedFeature: <dasZuletztGeklickteFeature> }'
         */
        var createBlMap = function(data, onBlFeatureClick) {
            var obj = {
                scale: d3.scale.linear().domain(d3.extent(data, function(d) { return d.value; })).range(["yellow", "red"]),
                control: $.rki.chart.map.create({ element: "#bl", height: 700 }),
            };

            // featureCollection erzeugen und Daten in die Features mappen
            var featureCollection = topojson.feature(blTopo, blTopo.objects.bundesland2012);
            mergeDataIntoFeatures(featureCollection, data, function(d, f) {
                return d.id.id === "[" + f.properties.RKI_ID + "]";
            });
            obj.featureCollection = featureCollection;

            // Layer mit featureCollection erzeugen. Die fill-Eigenschaft eines Polygons wird mit der erzeugten Farbskala ermittelt.
            obj.layer = obj.control.addLayer("bundesland", obj.featureCollection, function(p) {
                p.attr({
                    "fill": function(d) { return obj.scale(d.mappedData.value); },
                    "opacity": function(d) { return !obj.selectedFeature || d.properties.RKI_ID === obj.selectedFeature.properties.RKI_ID ? "1.0" : "0.3"; },
                    "class": function() { return !obj.selectedFeature ? "hover" : null; },
                }).style({
                    "stroke-width": function(d) { return (obj.selectedFeature && obj.selectedFeature.properties.RKI_ID === d.properties.RKI_ID) ? 5 : null; },
                    "stroke": function(d) { return (obj.selectedFeature && obj.selectedFeature.properties.RKI_ID === d.properties.RKI_ID) ? "black" : null; }
                }).on({
                    "click": function(d) {
                        obj.selectedFeature = d;
                        this.parentNode.appendChild(this);
                        // Aufruf der übergebenen Klick-Funktion
                        if (onBlFeatureClick) {
                            onBlFeatureClick(d);    
                        }
                    },
                    "mouseover": blTip.show,
                    "mouseout": blTip.hide
                });
            });
            obj.control.centerLayer(obj.layer);


            return obj;
        }

        var lkFilter = function(f) { return !f.properties.RKI_ID.indexOf("09"); };
        var lkMap = createLkMap(lkData, lkFilter);

        var lkLayer,
            blMap,
            blTip = d3.tip().attr('class', 'd3-tip').html(function(d) {
                return "" +
                    "<span>" + d.properties.RKI_NameDE + "  </span>" +
                    "<span class=\"badge\">" + DE.numberFormat(",")(d.mappedData.value) + "</span>";
            }),
            backBtn = d3.select("#btnBack").on("click", function() {
                // Wenn Landkreis-Layer vorhanden, dann entfernen
                if (lkLayer) {
                    blMap.control.removeLayer(lkLayer);
                    lkLayer = null;
                }
                
                // Ausgewähltes Bundesland entfernen und wieder Bundesland-Layer zentrieren.
                blMap.selectedFeature = null;
                blMap.control.centerLayer(blMap.layer);
                
                // Back-Button ausblenden.
                backBtn.classed("hidden", true);
            }),
            blClick = function(d) {
                // Tooltip ausblenden
                blTip.hide();

                // Landkreis aus der Landkreis-FeatureCollection filtern, die in dem ausgewählten Bundesland liegen.
                var lkFeaturesByBl = filterFeatureCollection(lkMap.featureCollection, function(x) {
                    return !x.properties.RKI_ID.indexOf(d.properties.RKI_ID);
                });

                // Farbskala für den Landkreis-Layer erzeugen
                var lkColorScale = d3.scale.linear()
                    .domain(d3.extent(lkFeaturesByBl.features, function(l) {
                        return l.mappedData.value;
                    }))
                    .range(["yellow", "red"]);

                // Landkreis-Layer erzugen und Farbskala für Fill-Eigenschaft nutzen
                lkLayer = blMap.control.addLayer("lkByBl" + d.properties.RKI_ID, lkFeaturesByBl,
                    function(lkp) {
                        lkp.attr("fill", function(x) { return lkColorScale(x.mappedData.value); })
                            .classed("landkreis", true)
                            .on({
                                "mouseover": blTip.show,
                                "mouseout": blTip.hide
                            });
                    });
                // Landkreis-Layer zentrieren.
                blMap.control.centerLayer(lkLayer);

                // Back-Button sichtbar machen.
                backBtn.classed("hidden", false);
            };

        blMap = createBlMap(blData, blClick);
        //Tooltip für Bundesland-Karte einbinden.
        blMap.control.layout.elements.svg.call(blTip);

    </script><div class="d3-tip" style="position: absolute; top: 0px; opacity: 0; pointer-events: none; box-sizing: border-box;"></div>
